import 'Attributes.dart';enum Lang{ru,uz,en}class Catalog {  Catalog({   required this.id,   required this.nameUz,   required this.nameRu,   required this.nameEn,   required this.count,   required this.price,   required this.discountPrice,   required this.aboutUz,   required this.aboutRu,   required this.aboutEn,   required this.image,   required this.countryId,   required this.countryUz,   required this.countryRu,   required this.countryEn,   required this.categoryId,   required this.categoryUz,   required this.categoryRu,   required this.categoryEn,   required this.attributeId,   required this.manufacturerId,   required this.manufacturerUz,   required this.manufacturerRu,   required this.manufacturerEn,   required this.statusId,   required this.statusUz,   required this.statusRu,   required this.statusEn,   required this.attributes,});  Catalog.fromJson(dynamic json) {    id = json['id'];    nameUz = json['name_uz'];    nameRu = json['name_ru'];    nameEn = json['name_en'];    count = json['count'];    price = json['price'];    discountPrice = json['discount_price'];    aboutUz = json['about_uz'];    aboutRu = json['about_ru'];    aboutEn = json['about_en'];    image = json['image'] != null ? json['image'].cast<String>() : [];    countryId = json['country_id'];    countryUz = json['country_uz'];    countryRu = json['country_ru'];    countryEn = json['country_en'];    categoryId = json['category_id'];    categoryUz = json['category_uz'];    categoryRu = json['category_ru'];    categoryEn = json['category_en'];    attributeId = json['attribute_id'] != null ? json['attribute_id'].cast<int>() : [];    manufacturerId = json['manufacturer_id'];    manufacturerUz = json['manufacturer_uz'];    manufacturerRu = json['manufacturer_ru'];    manufacturerEn = json['manufacturer_en'];    statusId = json['status_id'];    statusUz = json['status_uz'];    statusRu = json['status_ru'];    statusEn = json['status_en'];    if (json['attributes'] != null) {      attributes = [];      json['attributes'].forEach((v) {        attributes.add(Attributes.fromJson(v));      });    }  } late int id;late String nameUz;late String nameRu;late String nameEn;late int count;late int price;late int discountPrice;late String aboutUz;late String aboutRu;late String aboutEn;late List<String> image;late int countryId;late String countryUz;late String countryRu;late String countryEn;late int categoryId;late String categoryUz;late String categoryRu;late String categoryEn;late List<int> attributeId;late int manufacturerId;late String manufacturerUz;late String manufacturerRu;late String manufacturerEn;late int statusId;late String statusUz;late String statusRu;late String statusEn;late List<Attributes> attributes;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['name_uz'] = nameUz;    map['name_ru'] = nameRu;    map['name_en'] = nameEn;    map['count'] = count;    map['price'] = price;    map['discount_price'] = discountPrice;    map['about_uz'] = aboutUz;    map['about_ru'] = aboutRu;    map['about_en'] = aboutEn;    map['image'] = image;    map['country_id'] = countryId;    map['country_uz'] = countryUz;    map['country_ru'] = countryRu;    map['country_en'] = countryEn;    map['category_id'] = categoryId;    map['category_uz'] = categoryUz;    map['category_ru'] = categoryRu;    map['category_en'] = categoryEn;    map['attribute_id'] = attributeId;    map['manufacturer_id'] = manufacturerId;    map['manufacturer_uz'] = manufacturerUz;    map['manufacturer_ru'] = manufacturerRu;    map['manufacturer_en'] = manufacturerEn;    map['status_id'] = statusId;    map['status_uz'] = statusUz;    map['status_ru'] = statusRu;    map['status_en'] = statusEn;    return map;  }}